parsed = []
for line in text:
    parsed.append([c == "@" for c in line])

def check(i, j):
    c = 0
    for i1 in [-1, 0, 1]:
        for j1 in [-1, 0, 1]:
            if i1 == 0 and j1 == 0:
                continue
            if 0 <= i + i1 < len(parsed) and 0 <= j + j1 < len(parsed[0]):
                if parsed[i + i1][j + j1]:
                    c += 1
                    if c >=4:
                        return False
    return True

n=0
n1=1
while n1 != n:
    n1 = n
    for (i, row) in enumerate(parsed):
        for (j,val) in enumerate(row):
            if val:
                if check(i, j):
                    n += 1
                    parsed[i][j] = False
print(n)